:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Thomas Coldham and BEETHAM, Anne Palmer (Annie)
  JWILLIAMS, Guy Coldham and HOPE-LEWIS, Eileen
  JWILLIAMS, Alister Coldham and TESCHEMAKER, Nancy
  JWILLIAMS, Thomas Coldham and PHELPS, Gay
  WILLIAMS, Thomas Coldham and PHELPS, Gay (cont...)
  with a group of New Zealanders, in a joint venture deer farming operation in Argentina, with Argentine
  partners.
  On the death of Alister in 1971, Tom was elected to replace his father on the Masterton County Council.
  He served on the Council for twelve years, three as Deputy Chairman and six years as Chairman, retiring
  in 1983. Tom was elected the inaugural Chaiman of the New Zealand Game Industry Board set up in 1983 by
  the Deer Farmers Association to co-ordinate the marketing of venison and deer products. He retired in
  June 1994. More recently Tom was a member of the Ministerial Committee set by the Minister of Racing in
  1991 to study and report on New Zealand racing and betting systems. This led to his appointment as
  Chairman of the New Zealand Racing Authority (Racing Industry Board) on the retirement of Mr J Bennett
  in 1992. Tom had previously served on the Masterton Racing Club Committee from 1965 until he retired as
  Vice-President in 1991. He also served on the New Zealand Thoroughbred Breeders Association from 1987
  until 1992. He was a member of the Executive for four years. Tom retired from the Racing Industry
  Board in July 1996. He was awarded a Commemoration Medal in 1990 and the QSO in the New Year Honours
  list of 1996/97.
  Tom's other interests include vintage aviation. He was instrumental in establishing the New Zealand
  Sport and Vintage Aero Society (Inc) at Hood Aerodrome, Masterton. The Society is dedicated to the
  preservation and flying of vintage aircraft. Tom personally owns Dominie AKY and Tiger Moth BAT.
  Gay was educated at Solway College, Masterton, Auckland University and Auckland Teachers' Training
  College and became a primary school teacher. She trained in music to grade 8. Gay won the Miss New
  Zealand title in 1965, and returned to teaching at Hadlow Prep School in 1967.
  01> WILLIAMS, Guy Coldham
  b 21.04.1970
  Guy was educated at Huntley School and Wanganui Collegiate School. He was in the 1st rowing VIII
  and the 1st rugby XV for two years, and was captain of both in his last year. Guy was included in
  an under 19 New Zealand VIII to row against an under 19 Australian crew in his final year at
  Wanganui. The NZ team won 8-0.
  After leaving school he worked at the Waitotara Meat Processing plant for three years, and
  subsequently managed a small meat and fish packing plant in Masterton. He travelled to the United
  Kingdom and Europe in 1994-95 where he met and became engaged to Melanie Grant, a veterinarian from
  Oxford.
  Guy is presently employed by Wrightson in Masterton as their deer and stud stock agent and also
  part-time managing "Te Parae".
  02> WILLIAMS, Timothy Edward
  b 06.09.1971
  Timothy was educated at Huntley School and Wanganui Collegiate School. He learnt to shear at the
  Wairarapa training farm and has completed several short courses at Flock House, Tim has been a
  regular competitor at the Golden Shears in Masterton. He has recently returned from a season in
  Argentina where he was working as part of a helicopter deer recovery crew operating for the New
  Zealand - Argentinian joint venture company. He now works half the year in the USA for a New
  Zealand based company, Wild Life Management, who are contracted to the US Wildlife Department and
  involved in wildlife management in Canada, USA and Mexico. The rest of the year is spent working
  with helicopters in New Zealand,
  03> WILLIAMS, Angela Gay
  b 26.07.1973
  Angela was educated at Hadlow School, St Matthews at Masterton and Woodford House. When policy was
  changed to accept girls at Wanganui Collegiate School, Angela was amongst the first intake for her
  last year at school, 1991. She was captain of the girls' hockey XI. She took up a tutorship at
  Downe House School, Newbury, Berkshire, England. After returning to New Zealand, she worked as a
  chef in Queenstown and Kaikoura and is presently studying for a Diploma in Veterinary Nursing at
  Palmerston North Polytechnic.
